import { useRef } from "react";

const Contact = () => {
  return (
    <div>
      <h1 class="jt --debug">
        <span class="jt__row">
          <span class="jt__text">Jonas</span>
        </span>
        <span class="jt__row jt__row--sibling" aria-hidden="true">
          <span class="jt__text">Jonas</span>
        </span>
        <span class="jt__row jt__row--sibling" aria-hidden="true">
          <span class="jt__text">Jonas</span>
        </span>
        <span class="jt__row jt__row--sibling" aria-hidden="true">
          <span class="jt__text">Jonas</span>
        </span>
      </h1>
    </div>
  );
};

export default Contact;
